const Sidebar = () => {
    return (
      <nav className="navbar navbar-dark bg-dark">
      <div className="container">
        <a className="navbar-brand text-uppercase" href="/">
          "Lista de estudiantes"
        </a>
        <a className="navbar-brand text-uppercase" href="/">
          "Lista de Tareas"
        </a>
      </div>
    </nav>
        );
  };
  export default Sidebar
